@lukecwik sorry for the long wait, I am working on implementing the changes you proposed and would like to clarify the following:
- I feel like the proposed test does not really cover the concept of immutability. especially I can imagine a situation where a modified value will generate a Structural value that is of same type of the original object. I therefore wonder if we want to use Strutural values to provide a semantic for immutability.
Thanks.
